                      "classNames" : "EmployeeMaster",
                           "ui:order" :["Title","id","EmployeeFirstName","EmployeeMiddleName","EmployeeLastName","EmployeeSurrName","EmployeeDOB"
                                           ,"EmployeeDOC","EmployeeDOJ","EmployeeNationalLanguage","EmployeeBloodGroup"
                           ]
}
}
