    constructor(){
           super()
           this.onSubmit = this.onSubmit.bind(this)
    }

    onSubmit(formData){
            console.log(formData.formData)
    }
    render() {
        return(
            <div>
                <Form onSubmit = {this.onSubmit} schema = {this.props.employeeMasterSchema} uiSchema={UiSchema}/>
            </div>
        )
    }
}
